/** @jsx jsx */
import { jsx, Box, Heading, Container } from 'theme-ui';

const BannerSecundario = ({ title, banner }) => {
  return (
    <Box as="section" sx={{ backgroundImage: `url(${banner})` }, styles.section } >
      <Container>
        <Heading sx={styles.title} as="h2">{title}</Heading>
      </Container>
    </Box>
  );
};

export default BannerSecundario;

const styles = {
  section: {
    backgroundColor: 'primary',
    backgroundImage: `url(${banner})`,
    pt: [17, null, null, 20, null],
    pb: [6, null, null, 12, 16],
  },
  title: {
    fontSize: [15],
    color: 'secondary',
    textAlign: 'center'
  }
};
